- input: "TEXT\x1CC00155952\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission's letter dated May 20, 2008.  The receipts from MidAtlantic Regional
    Council of Carpenters PAC, Pullar for Senate, and Virginia Leadership PAC for
    inadvertently deposited into the Committee's Federal Account.  They have been
    moved to the Committee's Non-Federal Account. The payments for 'Event Consulting'
    and 'Event Consulting Fees' were for General Event consulting relating to the
    Committee's Annual Jefferson Jackson Day Dinner. Payments for 'JJ Consulting Expenses'
    and 'JJ Consulting Fees' were for general fundraising advising relating to the
    2008 Annual Jefferson Jackson Dinner.  The prices paid for voter file purchases
    are established using comparable prices charged by other state party committees
    throughout the country on a per record cost. The exact price paid to the Committee
    by each entity is determined by multiplying the per record cost by the number
    of records provided in the file purchased, or a set price for a statewide voter
    file, also determined by the total number of records included in the file.  This
    is considered the 'usual and normal charge' for the good provided. "
